INSERT INTO `tbl_traffic_sign` VALUES (1, 'Cấm dừng và đỗ xe', 'cam_dung_va_do_xe', 'Biển báo này quy định các phương tiện không được dừng hoặc đỗ tại vị trí đặt biển, nhằm đảm bảo lưu thông thông thoáng và an toàn cho khu vực.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://bizweb.dktcdn.net/100/378/087/products/bien-bao-giao-thong.jpg?v=1583945216690', 1);
INSERT INTO `tbl_traffic_sign` VALUES (2, 'Cấm rẽ trái', 'cam_re_trai', 'Biển này yêu cầu tất cả các phương tiện không được phép rẽ trái tại ngã tư hoặc vị trí cụ thể để tránh xung đột giao thông và tai nạn.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://www.thietbithinhphat.com/wp-content/uploads/2023/01/Bien-cam-re-trai-510x510-1.jpg', 1);
INSERT INTO `tbl_traffic_sign` VALUES (3, 'Giới hạn tốc độ', 'gioi_han_toc_do', 'Biển báo này quy định tốc độ tối đa cho phép mà các phương tiện có thể di chuyển trong khu vực hoặc đoạn đường được chỉ định, nhằm bảo đảm an toàn giao thông.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://bizweb.dktcdn.net/100/415/690/files/cac-bien-bao-toc-do-2.jpg?v=1677145397513', 1);
INSERT INTO `tbl_traffic_sign` VALUES (4, 'Biển báo cấm', 'bien_bao_cam', 'Biển này thông báo một lệnh cấm chung cho các phương tiện hoặc hành vi cụ thể như cấm xe máy, xe tải, hoặc cấm vượt tại khu vực nhất định.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://carpla.vn/blog/wp-content/uploads/2023/11/cac-loai-bien-bao-cam.jpg', 1);
INSERT INTO `tbl_traffic_sign` VALUES (5, 'Biển báo nguy hiểm', 'bien_nguy_hiem', 'Biển này cảnh báo các tình huống giao thông nguy hiểm như đường cong gấp, lối đi có dốc lớn, hoặc khu vực dễ sạt lở, yêu cầu các tài xế giảm tốc độ và chú ý quan sát.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://image3.luatvietnam.vn/uploaded/images/original/2024/03/27/bien-bao-nguy-hiem-la-gi_2703152112.jpg', 2);
INSERT INTO `tbl_traffic_sign` VALUES (6, 'Biển hiệu lệnh', 'bien_hieu_lenh', 'Biển này chỉ dẫn bắt buộc về hướng đi hoặc hành vi mà người điều khiển phương tiện cần tuân thủ, như đi thẳng, rẽ phải, hoặc đi vào khu vực hạn chế.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://cdn.thuvienphapluat.vn/uploads/tintuc/2022/10/15/bien-bao-R.301.jpg', 4);
INSERT INTO `tbl_traffic_sign` VALUES (14, 'updateNamee', 'updatenamee', 'updateDescription', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734365850/jbmir22dlsfheb1hsioi.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (18, 'duy đỗ bá', 'duy_đo_ba', 'ddddddddddddddddddđ', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734364953/ucdy8mqipdxagaygsohw.jpg', 1);
INSERT INTO `tbl_traffic_sign` VALUES (20, 'Đường cấm', 'đuong_cam', 'Cấm tất cả các phương tiện cơ giới, thô sơ đi lại cả hai hướng, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366593/vfqpv8omjvehorwb4dgo.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (22, 'Cấm ô tô', 'cam_o_to', 'Cấm tất cả các loại xe cơ giới kể cả môtô 3 bánh có thùng, trừ môtô 2 bánh, xe gắn máy và xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366664/d7tyrnoprmx4bgxgzbr7.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (23, 'Cấm ô tô rẽ phải', 'cam_o_to_re_phai', 'Cấm xe cơ giới bao gồm cả môtô 3 bánh có thùng RẼ PHẢI, trừ môtô 2 bánh, xe gắn máy và xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366676/bfi1bmnbgcro6z7o6z1o.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (24, 'Cấm ô tô rẽ trái', 'cam_o_to_re_trai', 'Cấm xe cơ giới bao gồm cả mô tô 3 bánh có thùng RẼ TRÁI, trừ mô tô 2 bánh, xe gắn máy và xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366687/itb6sp5blcjlozdxgb5u.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (25, 'Cấm mô tô', 'cam_mo_to', 'Cấm tất cả các loại mô tô, trừ mô tô được ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366759/qxgjxlowxbybi57tc3dv.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (26, 'Cấm ô tô và mô tô', 'cam_o_to_va_mo_to', 'Cấm tất cả các loại xe cơ giới và mô tô đi qua, trừ xe gắn máy và xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366774/uefrooll7pjvmps5cjqd.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (27, 'Cấm xe tải', 'cam_xe_tai', 'Cấm tất cả các loại ô tô chở hàng có trọng tải từ 1,5 tấn trở lên, trừ xe ưu tiên. Biển có hiệu lực cả với xe máy kéo, xe máy chuyên dùng.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366787/yoychgjajymv8iawaput.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (28, 'Cấm xe tải từ 2,5 tấn', 'cam_xe_tai_tu_2,5_tan', 'Cấm xe có tổng trọng lượng (trọng lượng xe cộng hàng) vượt quá con số ghi trên biển. Biển có hiệu lực cả với xe máy kéo, xe máy chuyên dùng.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366823/fmfvtgekgsmm7ly5ln3q.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (29, 'Cấm xe chở hàng nguy hiểm', 'cam_xe_cho_hang_nguy_hiem', 'Cấm xe chở hàng nguy hiểm', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366847/qhgjpc8jqqlfaw5nh5ge.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (30, 'Cấm ô tô khách và ô tô tải', 'cam_o_to_khach_va_o_to_tai', 'Cấm ô tô chở khách và các loại ô tô tải kể cả máy kéo và xe máy thi công chuyên dùng, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366875/ayqjvzoeu0pxacaueeo9.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (31, 'Cấm xe rơ moóc', 'cam_xe_ro_mooc', 'Cấm tất cả các loại xe cơ giới kéo theo rơ-moóc kể cả mô tô, máy kéo, ô tô khách kéo theo rơ-moóc đi qua, trừ loại ô tô sơ-mi rơ-moóc và các xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734366982/qnndtansyitclxbwszct.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (32, 'Cấm máy kéo', 'cam_may_keo', 'Cấm tất cả các loại máy kéo, kể cả máy kéo bánh hơi và bánh xích.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367035/ctwtpumhgnjrfk8ygfle.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (33, 'Cấm đi xe đạp', 'cam_đi_xe_đap', 'Cấm xe đạp đi qua. Biển không có giá trị cấm người dắt xe đạp.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367044/sr2nmm1gkfc44lfmwtp2.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (34, 'Cấm xe đạp thồ', 'cam_xe_đap_tho', 'Cấm xe đạp thồ đi qua. Biển không cấm người dắt loại xe này.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367053/z2uokjric4kucp4yjcya.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (35, 'Cấm xe gắn máy', 'cam_xe_gan_may', 'Cấm xe gắn máy. Biển không có giá trị với xe đạp.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367067/h56ywmvqkdcfem5kr6yr.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (36, 'Cấm xe lam', 'cam_xe_lam', 'Cấm xe 3 bánh loại có động cơ như xe lam, xích lô máy...', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367080/cdsoshz8bnl27imhgsqx.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (37, 'Cấm xe lôi máy', 'cam_xe_loi_may', 'Cấm xe ba bánh loại có động cơ như xe lôi máy...', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367133/ufr82ir2yfcqfln272u9.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (38, 'Cấm xe 3 bánh loại không có động cơ', 'cam_xe_3_banh_loai_khong_co_đong_co', 'Cấm xe 3 bánh loại không có động cơ như xích lô, xe lôi đạp...', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367153/btcfc4xktevw0fcqjgrg.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (39, 'Cấm người đi bộ', 'cam_nguoi_đi_bo', 'Cấm người đi bộ qua lại.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367161/mci0ic2mpaxwhapf6bif.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (40, 'Cấm xe người kéo, đẩy', 'cam_xe_nguoi_keo,_đay', 'Cấm xe thô sơ, chuyển động do người kéo, đẩy đi qua. Biển không có giá trị cấm xe nôi của trẻ em và phương tiện chuyên dùng để đi lại của người tàn tật.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367174/cg02f8onkgfwbsj7cnib.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (41, 'Cấm xe xúc vật kéo', 'cam_xe_xuc_vat_keo', 'Cấm súc vật vận tải hàng hóa hoặc hành khách dù kéo xe hay chở trên lưng.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367186/zfwqouvkxtwdgfon6u0b.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (42, 'Hạn chế trọng lượng xe', 'han_che_trong_luong_xe', 'Cấm các loại xe cơ giới và thô sơ, kể cả xe ưu tiên, có tổng trọng lượng (cả xe và hàng) vượt quá trị số ghi trên biển.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367198/mnjqjoy6kiggx1nupejn.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (43, 'Hạn chế trọng lượng trên trục xe', 'han_che_trong_luong_tren_truc_xe', 'Cấm xe cơ giới và thô sơ, kể cả xe ưu tiên, có tổng trọng lượng (cả xe và hàng) phân bổ trên một trục bất kỳ của xe vượt quá trị số ghi trên biển.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367209/udvb16nukteoicgde3pg.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (44, 'Hạn chế chiều cao', 'han_che_chieu_cao', 'Cấm xe cơ giới và thô sơ có chiều cao vượt quá trị số ghi trên biển, kể cả các xe ưu tiên (chiều cao tính từ mặt đường, mặt cầu đến điểm cao nhất của xe hoặc hàng).', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367221/iux6bt57x4tn3whrdefu.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (45, 'Hạn chế chiều ngang', 'han_che_chieu_ngang', 'Cấm xe cơ giới và thô sơ, kể cả xe ưu tiên có chiều ngang (kể cả xe và hàng hóa) vượt quá trị số ghi trên biển.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367230/fekze1wqqrwx3mus33gl.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (46, 'Hạn chế chiều dài ô tô', 'han_che_chieu_dai_o_to', 'Cấm xe cơ giới và thô sơ, kể cả xe ưu tiên, có độ dài toàn bộ kể cả xe và hàng lớn hơn trị số ghi trên biển.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367242/sf3gaovdxlf3cx0dwmpz.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (48, 'Hạn chế chiều dài ô tô, máy kéo kéo moóc, sơ mi rơ moóc', 'han_che_chieu_dai_o_to,_may_keo_keo_mooc,_so_mi_ro_mooc', 'Cấm xe cơ giới và thô sơ, kéo theo moóc kể cả ô tô sơ-mi rơ-moóc và các loại xe ưu tiên kéo moóc, có độ dài toàn bộ kể cả xe, moóc và hàng lớn hơn trị số ghi trên biển.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367254/p2mie9scvy9yjbjg4xsu.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (49, 'Cự ly tối thiểu giữa 2 xe', 'cu_ly_toi_thieu_giua_2_xe', '2 xe phải đi cách nhau một khoảng tối thiểu ghi trên biển (đơn vị tính bằng mét).', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367264/i6geew3kqap39cfow9g7.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (50, 'Dừng lại', 'dung_lai', 'Buộc xe cơ giới và thô sơ kể cả xe ưu tiên dừng lại trước biển hoặc trước vạch ngang đường và chỉ được phép đi khi thấy các tín hiệu (do người điều khiển giao thông hoặc đèn cờ) cho phép đi. Trong trường hợp trên đường không đặt tín hiệu đèn cờ, không có người điều khiển giao thông hoặc các tín hiệu đèn không bật sáng thì người lái xe chỉ được phép đi khi trên đường không còn nguy cơ mất an toàn giao thông.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367292/nda3qqbj0jkgeer5ww6c.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (52, 'Cấm rẽ phải', 'cam_re_phai', 'Cấm các loại xe cơ giới và thô sơ rẽ phải ở những vị trí đường giao nhau, trừ xe ưu tiên. Biển này không có giá trị cấm xe quay đầu.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367304/xxtls8grkcfdhbkccsf0.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (53, 'Cấm quay đầu xe', 'cam_quay_đau_xe', 'Cấm các loại xe cơ giới và thô sơ quay đầu (theo kiểu chữ U) trừ các xe ưu tiên. Biển này không cấm rẽ trái.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367331/iaxou1loeodgqhbypi9j.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (54, 'Cấm ô tô quay đầu xe', 'cam_o_to_quay_đau_xe', 'Cấm ô tô và mô tô 3 bánh quay đầu (theo kiểu chữ U) trừ xe ưu tiên. Biển này không cấm rẽ trái.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367382/cemuzyd2bzb9wk0ths0m.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (55, 'Cấm vượt', 'cam_vuot', 'Cấm các loại xe cơ giới vượt nhau kể cả xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367397/x4xioskce9vn92lmiu29.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (56, 'Cấm ô tô tải vượt', 'cam_o_to_tai_vuot', 'Cấm các loại ô tô tải vượt xe cơ giới khác. Biển có hiệu lực cấm tất cả các loại ô tô tải có trọng lượng lớn nhất cho phép (bao gồm trọng lượng xe và hàng) trên 3,5 tấn kể cả xe ưu tiên vượt xe cơ giới khác.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367415/sce46if2nwvscd9jksfi.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (57, 'Tốc độ tối đa cho phép', 'toc_đo_toi_đa_cho_phep', 'Tốc độ tối đa mà xe cơ giới được phép chạy, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367426/fdqag0goiyaqeehthn1q.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (58, 'Cấm sử dụng còi', 'cam_su_dung_coi', 'Cấm các loại xe cơ giới sử dụng còi.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367442/zt6t5az50dglyj1h0oja.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (59, 'Kiểm tra', 'kiem_tra', 'Báo nơi đặt chốt kiểm tra, các loại phương tiện vận tải qua đó phải dừng lại để làm thủ tục kiểm tra theo quy định.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367452/h5122gdddi2ewjuhxtaw.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (61, 'Cấm đỗ xe', 'cam_đo_xe', 'Cấm đỗ xe, trừ xe được ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367462/q6thrhtp80lr8ctspjru.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (62, 'Cấm đỗ xe ngày lẻ', 'cam_đo_xe_ngay_le', 'Cấm đỗ xe cơ giới vào ngày lẻ.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367473/xpyiaxmzuknosmtrqr52.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (63, 'Cấm đỗ xe ngày chẵn', 'cam_đo_xe_ngay_chan', 'Cấm đỗ xe cơ giới vào ngày chẵn.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367481/shegxvxanz3h45lijmjy.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (64, 'Nhường đường cho xe cơ giới đi ngược chiều qua đường hẹp', 'nhuong_đuong_cho_xe_co_gioi_đi_nguoc_chieu_qua_đuong_hep', 'Các loại xe cơ giới và thô sơ, kể cả xe ưu tiên phải nhường đường cho xe cơ giới đang đi theo hướng ngược lại qua các đoạn đường hẹp hoặc cầu hẹp.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367492/b7b2hfdmsx73kwyprav6.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (65, 'Hết cấm vượt', 'het_cam_vuot', 'Hết đoạn đường cấm vượt.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367509/qoswocbmszx2yzwwn7fa.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (66, 'Hết hạn chế tốc độ tối đa', 'het_han_che_toc_đo_toi_đa', 'Hết đoạn đường hạn chế tốc độ tối đa.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367525/ep3atgvm5ialnopldquy.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (67, 'Hết tất cả các lệnh cấm', 'het_tat_ca_cac_lenh_cam', 'Hết đoạn đường có nhiều biển báo cấm cùng hết hiệu lực.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367536/mfy76pefp4qxqc112cpv.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (68, 'Cấm đi thẳng', 'cam_đi_thang', 'Cấm tất cả các loại xe đi thẳng trên đoạn đường phía trước', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367548/gk6tkhfnaeeluwbrehum.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (69, 'Cấm rẽ trái và rẽ phải', 'cam_re_trai_va_re_phai', 'Cấm tất cả các loại xe rẽ trái và rẽ phải trên các ngả đường phía trước.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367558/bbt1stqvk22afagvzklq.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (70, 'Cấm đi thẳng và rẽ trái', 'cam_đi_thang_va_re_trai', 'Đường qua nút giao cấm tất cả các loại xe đi thẳng và rẽ trái.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367567/toyntzjeqqekpehfusxq.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (71, 'Cấm đi thẳng và rẽ phải', 'cam_đi_thang_va_re_phai', 'Cấm đi thẳng và rẽ phải', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367581/dlpm0ugqmddgyk1avipo.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (72, 'Cấm xe công nông', 'cam_xe_cong_nong', 'Đường cấm xe công nông đi vào.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367603/dxuipakhilpu0oiehaob.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (73, 'Cấm ô tô rẽ phải và quay đầu xe', 'cam_o_to_re_phai_va_quay_đau_xe', 'Cấm xe ô tô và mô tô 3 bánh quay đầu (theo kiểu chữ U) và rẽ phải, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367616/xtmwjgeen2fdrpkx9pod.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (74, 'Cấm ô tô rẽ trái và quay đầu xe', 'cam_o_to_re_trai_va_quay_đau_xe', 'Cấm xe ô tô và mô tô 3 bánh quay đầu (theo kiểu chữ U) và rẽ trái, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367624/uqbedt7ucof4jd72axe2.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (75, 'Cấm rẽ phải và quay đầu xe', 'cam_re_phai_va_quay_đau_xe', 'Cấm tất cả các loại xe thô sơ và cơ giới quay đầu (theo kiểu chữ U) và rẽ phải, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367658/pmmo2i9d3xf5iecvkbdm.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (76, 'Cấm rẽ trái và quay đầu xe', 'cam_re_trai_va_quay_đau_xe', 'Cấm tất cả các loại xe thô sơ và cơ giới quay đầu (theo kiểu chữ U) và rẽ trái, trừ xe ưu tiên.', '2024-11-27 13:30:56', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367667/osrnwhgngwbji7nf6pdu.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (80, 'Giao nhau cùng mức với đường tàu điện.', 'giao_nhau_cung_muc_voi_đuong_tau_đien.', 'Báo trước sắp đến chỗ giao nhau giao nhau cùng mức với đường tàu điện.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367812/gqup5jaamqit6hqjmw1e.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (81, 'Chỗ ngoặt nguy hiểm vòng bên trái.', 'cho_ngoat_nguy_hiem_vong_ben_trai.', 'Báo trước sắp tới chỗ ngoặt vòng bên trái.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367827/ogwhoccic8nebhwivqpl.png', 2);
