INSERT INTO `tbl_traffic_sign` VALUES (83, 'Hai chỗ ngoặt ngược chiều nhau liên tiếp bên trái.', 'hai_cho_ngoat_nguoc_chieu_nhau_lien_tiep_ben_trai.', 'Báo trước có từ 2 chỗ ngoặt, ở gần nhau trong đó có ít nhất một chỗ ngoặt nguy hiểm mà chỗ ngoặt đầu tiên hướng vòng bên trái.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367910/ko30on3hridw8audu0b3.png', 2);
