INSERT INTO `tbl_traffic_sign` VALUES (85, 'Đường bị thu hẹp cả hai bên.', 'đuong_bi_thu_hep_ca_hai_ben.', 'Báo trước đường sắp bị thu hẹp cả hai bên.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734367955/mluwile5wlwtcupgnlzb.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (86, 'Chỗ ngoặt nguy hiểm có nguy cơ lật xe bên phải.', 'cho_ngoat_nguy_hiem_co_nguy_co_lat_xe_ben_phai.', 'Báo trước sắp tới chỗ ngoặt nguy hiểm có nguy cơ lật xe bên phải khi đường cong vòng sang trái.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368015/zt1us0rockkrr1ygkbqf.png', 2);
