INSERT INTO `tbl_traffic_sign` VALUES (88, 'Đường 2 chiều.', 'đuong_2_chieu.', 'Báo đoạn đường phía trước do sửa chữa hoặc có trở ngại khác nên phải đi vào phần đường còn lại hoặc đường tạm theo cả 2 chiều.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368058/wmhdxmfvaprqxhnicoic.png', 2);
