INSERT INTO `tbl_traffic_sign` VALUES (99, 'Giao nhau với đường không ưu tiên.', 'giao_nhau_voi_đuong_khong_uu_tien.', 'Đặt trên đường ưu tiên, để báo trước sắp đến nơi giao nhau với đường không ưu tiên ở bên phải và phía trước.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368664/i1cfab1ztez3zntxlycl.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (100, 'Giao nhau với đường không ưu tiên', 'giao_nhau_voi_đuong_khong_uu_tien', 'Đặt trên đường ưu tiên, để báo trước sắp đến nơi giao nhau với đường không ưu tiên ở phía trước.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368756/t0d1mhcuiy7ugzwudmj0.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (101, 'Giao nhau với đường không ưu tiên.', 'giao_nhau_voi_đuong_khong_uu_tien.', 'Đặt trên đường ưu tiên, để báo trước sắp đến nơi giao nhau với đường không ưu tiên ở bên trái và phía trước.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368853/x9ikkrpyq25w0dvtxcfy.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (102, 'Cầu hẹp.', 'cau_hep.', 'Báo cầu phía trước là loại cầu có chiều rộng phần xe chạy nhỏ hơn hoặc bằng 1 làn đường (4,5m). Các xe khi lưu thông qua loại cầu này phải nhường nhau và chờ ở 2 đầu cầu.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368897/ai3whwjfypu5ati5nyu3.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (103, 'Cầu tạm', 'cau_tam', 'Báo cầu phía trước là loại cầu tạm, được làm để sử dụng tạm thời cho xe qua lại.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368940/fgkvibxnahyir3jtyxez.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (104, 'Cầu xoay – cầu cất', 'cau_xoay_–_cau_cat', 'Báo cầu phía trước là loại cầu xoay, cầu cất là những loại cầu trong từng khoảng thời gian có ngắt giao thông đường bộ để cho tàu thuyền qua lại. Các phương tiện đi trên đường bộ phải chờ đợi để đi qua.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368972/lsmht4ln37ozf5nsjr6o.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (105, 'Kè – vực sâu phía trước.', 'ke_–_vuc_sau_phia_truoc.', 'Báo phía trước có bờ kè, vực sâu, hoặc bờ sông áp sát đường phía trước, cần đề phòng tình huống nguy hiểm vượt kè, rơi  xuống vực sâu (thường cắm ở những chỗ ngoặt nguy hiểm).', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734368987/qgduyq2vt44qyinagjpb.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (106, 'Kè – vực sâu phía trước.', 'ke_–_vuc_sau_phia_truoc.', 'Báo phía trước có bờ kè, vực sâu, hoặc bờ sông áp sát đường phía bên phải, cần đề phòng tình huống nguy hiểm vượt kè, rơi  xuống vực sâu (thường cắm ở những chỗ ngoặt nguy hiểm).', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369013/qm8hvxsf3olcvqua1nw8.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (107, 'Kè – vực sâu phía trước.', 'ke_–_vuc_sau_phia_truoc.', 'Báo phía trước có bờ kè, vực sâu, hoặc bờ sông áp sát đường phía bên trái, cần đề phòng tình huống nguy hiểm vượt kè, rơi  xuống vực sâu (thường cắm ở những chỗ ngoặt nguy hiểm).', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369091/sgmczxwz8niwbspznnhe.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (108, 'Đường ngầm', 'đuong_ngam', 'Báo trước những chỗ có đường ngầm (đường tràn). Đường ngầm là những đoạn đường vượt qua sông, suối, khe cạn mà nước có thể chảy tràn qua mặt đường thường xuyên.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369117/nbmesmrt2lnylsfbdeo5.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (109, 'Bến phà', 'ben_pha', 'Báo trước sắp đến bến phà.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369128/vbuwcwryewz3wifznmpm.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (110, 'Dốc lên nguy hiểm.', 'doc_len_nguy_hiem.', 'Báo trước sắp lên dốc nguy  hiểm,người điều khiển phương tiện phải chọn cách chạy phù hợp để đảm bảo an toàn.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369179/qidc8911ll8zefwr9trf.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (111, 'Đường không bằng phẳng.', 'đuong_khong_bang_phang.', 'Báo trước sắp tới đoạn đường có mặt đường không bằng phẳng, lồi lõm, sống trâu,… xe chạy với tốc độ cao sẽ bị nguy hiểm.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369201/bbwmabkjx1zmih6ber8o.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (112, 'Đường không bằng phẳng', 'đuong_khong_bang_phang', 'Báo trước đoạn đường có sóng mấp mô nhân tạo (gờ giảm tốc) để hạn chế tốc độ xe chạy, bắt buộc lái xe phải chạy với tốc độ chậm trước khi qua những điểm cần kiểm soát, kiểm tra hay khu đông dân cư,…', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369225/vfbdlznsfy4xrr4vwzpi.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (113, 'Đường trơn.', 'đuong_tron.', 'Báo trước  sắp tới đoạn đường có thể xảy ra trơn trượt khi thời tiết xấu, cần tránh hãm phanh, tăng ga, sang số đột ngột hoặc xe chạy với tốc độ cao sẽ gặp nguy hiểm. Khi gặp biển báo này người điều khiển phương tiện phải giảm tốc độ xe chạy và thận trọng', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369241/yj7fp9vusxbzt0wq4g0k.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (114, 'Lề nguy hiểm.', 'le_nguy_hiem.', 'Để báo những nơi lề đường không ổn định, khi xe đi vào dễ gây văng đất đá hoặc bánh xe quay tại chỗ.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369254/v5jjvczejju2jsen9ju6.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (115, 'Vách núi nguy hiểm.', 'vach_nui_nguy_hiem.', 'Báo trước đường đi sát vách núi bên trái.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369275/fagzbkzvhdatogdisx7y.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (116, 'Vách núi nguy hiểm.', 'vach_nui_nguy_hiem.', 'Báo trước đường đi sát vách núi bên phải.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369285/mu4wdtzas7llbaktktaf.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (117, 'Đường dành cho người đi bộ cắt ngang.', 'đuong_danh_cho_nguoi_đi_bo_cat_ngang.', 'Báo trước sắp đến phần đường ngang dành cho người đi bộ qua đường, các loại xe cộ phải nhường ưu tiên cho người đi bộ và chỉ được chạy xe nếu như không gây nguy hiểm cho người đi bộ.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369297/jiz4mni9xrfsztxlhp11.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (118, 'Trẻ em', 'tre_em', 'Báo trước gần đến đoạn đường thường có trẻ em đi ngang qua hoặc tụ tập trên đường vườn trẻ, trường học,…', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369346/dkakrw2whmoovnsmh1e0.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (119, 'Đường người đi xe đạp cắt ngang.', 'đuong_nguoi_đi_xe_đap_cat_ngang.', 'Báo trước đến đoạn đường thường có người đi xe đạp từ những đường nhỏ cắt ngang hoặc từ đường dành cho xe đạp nhập vào đường ô tô.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369367/kpbry46ssm1yunlspqgc.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (120, 'Công trường', 'cong_truong', 'Báo trước gần tới đoạn đường đang tiến hành tu sửa có người và máy móc đang làm việc trên mặt đường. Người điều khiển phương tiện phải giảm tốc độ xe, không gây nguy hiểm cho người và máy móc trên đoạn đường đó.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369379/uvjo99305alyfdbzdrjn.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (121, 'Đá lở', 'đa_lo', 'Báo trước gần tới một đoạn đường có thể có đất đá từ trên ta luy sụt lở bất ngờ gây nguy hiểm cho xe cộ và người đi đường, đặc biệt là ở những đoạn đường miền núi. Người lái xe phải chú ý đặc biệt khi thời tiết xấu khi tầm nhìn bị hạn chế và khi dừng hay đỗ xe sau những trận mưa lớn.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369424/wegaod1oknsrbmiwsfwr.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (122, 'Đá lở', 'đa_lo', 'Báo trước gần tới một đoạn đường có thể có đất đá từ trên ta luy sụt lở bất ngờ gây nguy hiểm cho xe cộ và người đi đường, đặc biệt là ở những đoạn đường miền núi. Người lái xe phải chú ý đặc biệt khi thời tiết xấu khi tầm nhìn bị hạn chế và khi dừng hay đỗ xe sau những trận mưa lớn.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369436/fyhc4liigc3w5asw4jc1.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (123, 'Sỏi đá bắn lên', 'soi_đa_ban_len', 'Để báo trước nơi có kết cấu mặt đường rời rạc, khi phương tiện đi qua, làm cho các viên đá, sỏi băng lên gây nguy hiểm và mất an toàn cho người và phương tiện tham gia giao thông.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369463/jzfd9v0kbhircjf9vvrd.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (124, 'Nền đường yếu', 'nen_đuong_yeu', 'Để cảnh báo những đoạn nền đường yếu, đoạn đường đang theo dõi lún mà việc vận hành xe ở tốc độ cao có thể gây nguy hiểm.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369477/ogmnhh3rasvcvurojz7l.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (125, 'Dải máy bay lên xuống.', 'dai_may_bay_len_xuong.', 'Báo trước tới đoạn đường sát đường băng của sân bay và cắt ngang qua hướng máy bay lên xuống ở độ cao nhỏ.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369520/cenak2itxlqumbfy01lz.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (126, 'Gia súc.', 'gia_suc.', 'Báo trước tới đoạn đường thường có gia súc thả rông hoặc lùa qua ngang đường nguy hiểm, biển này thường đặt ở vùng đồng cỏ của nông trường chăn nuôi, vùng thảo nguyên. Người lái xe có trách nhiệm dừng lại bảo đảm cho gia súc có thể qua đường không bị nguy hiểm.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369533/btbl633ljulm5fl8s80i.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (127, 'Thú rừng vượt qua đường.', 'thu_rung_vuot_qua_đuong.', 'Báo trước tới đoạn đường thường có thú rừng qua đường.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369545/mn35vlpgoqxyb6ekveyu.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (128, 'Gió ngang.', 'gio_ngang.', 'Báo trước  tới đoạn đường thường có gió ngang thổi mạnh nguy hiểm. Người lái xe cần đề phòng tình huống gió thổi lật xe.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369557/jzybikcrucz1g4tyhwns.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (129, 'Đường đôi.', 'đuong_đoi.', 'Báo hiệu  sắp tới đoạn đường đôi (2 chiều phân biệt rõ ràng bằng giải phân cách cứng).', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369591/fvt3g4mqtcsfvhlxjz2s.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (130, 'Hết đường đôi.', 'het_đuong_đoi.', 'Hết đường đôi.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369606/wpbgmpuaypwqsyrsz7dt.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (131, 'Đường cáp điện ở phía trên.', 'đuong_cap_đien_o_phia_tren.', 'Báo trước đoạn đường có đường dây điện cắt ngang phía trên tuyến đường, thường kèm theo biển phụ “Chiều cao an toàn” ở phía dưới.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369631/uaeekqiyhd5m3lbzzvfp.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (132, 'Chiều cao an toàn.', 'chieu_cao_an_toan.', 'Để báo chiều cao tĩnh không thực tế của các vị trí có khoảng cách từ điểm cao nhất của mặt đường đến điểm thấp nhất của chướng ngại vật bị giới hạn.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369729/pi99xty0kbyd46hzbrsi.jpg', 2);
INSERT INTO `tbl_traffic_sign` VALUES (133, 'Đường hầm.', 'đuong_ham.', 'Báo trước sắp đi vào đường hầm chạy hai chiều, mà chiếu sáng lại không tốt.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369763/xuefaaqtkozdmiiaibnk.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (134, 'Ùn tắc giao thông.', 'un_tac_giao_thong.', 'Để báo đoạn đường hay xảy ra ùn tắc giao thông.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369824/f9kwseor3fgxoahfkkuy.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (135, 'Nơi đường sắt giao không vuông góc với đường bộ.', 'noi_đuong_sat_giao_khong_vuong_goc_voi_đuong_bo.', 'Để báo trước sắp đến vị trí giao cắt đường bộ với đường sắt cùng mức, không vuông góc và không có người gác, không có rào chắn, đặt ở nơi cách ray gần nhất nơi giao đường sắt 50 m. Biển được đặt ở phía dưới biển số W.211 “Giao nhau với đường sắt không có rào chắn”.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369935/ibo2vzintps6d2hjv9mh.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (136, 'Nơi đường sắt giao không vuông góc với đường bộ.', 'noi_đuong_sat_giao_khong_vuong_goc_voi_đuong_bo.', 'Để báo trước sắp đến vị trí giao cắt đường bộ với đường sắt cùng mức, không vuông góc và không có người gác, không có rào chắn, đặt ở nơi cách ray gần nhất nơi giao đường sắt 100 m. Biển được đặt ở phía dưới biển số W.211 “Giao nhau với đường sắt không có rào chắn”.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369947/syorj8pllo8nfnrqj3lr.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (137, 'Nơi đường sắt giao không vuông góc với đường bộ.', 'noi_đuong_sat_giao_khong_vuong_goc_voi_đuong_bo.', 'Để báo trước sắp đến vị trí giao cắt đường bộ với đường sắt cùng mức, không vuông góc và không có người gác, không có rào chắn, đặt ở nơi cách ray gần nhất nơi giao đường sắt 150 m. Biển được đặt ở phía dưới biển số W.211 “Giao nhau với đường sắt không có rào chắn”.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734369962/zee9rqabeut2vquegcpo.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (138, 'Đoạn đường hay xảy ra tai nạn.', 'đoan_đuong_hay_xay_ra_tai_nan.', 'Đoạn đường hay xảy ra tai nạn.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370095/awhbsnbwxtnewvehjpdk.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (139, 'Đi chậm', 'đi_cham', 'Dùng để nhắc lái xe giảm tốc độ đi chậm.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370118/kwx7bobanzeg76rbj1sz.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (140, 'Chú ý chướng ngại vật – Vòng tránh ra hai bên.', 'chu_y_chuong_ngai_vat_–_vong_tranh_ra_hai_ben.', 'Báo trước chướng ngại vật phía trước, đi theo được cả 2 hướng mũi tên.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370133/omxjzjhgytcizsm9s6wp.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (141, 'Chú ý chướng ngại vật – Vòng tránh sang bên trái.', 'chu_y_chuong_ngai_vat_–_vong_tranh_sang_ben_trai.', 'Chướng ngại vật phía trước đi theo hướng mũi tên trên biển báo.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370143/mroj85jfqnhsc3zeztzh.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (142, 'Chú ý chướng ngại vật – Vòng tránh sang bên phải.', 'chu_y_chuong_ngai_vat_–_vong_tranh_sang_ben_phai.', 'Chướng ngại vật phía trước đi theo hướng mũi tên trên biển báo.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370161/f2h6avtmjpq5hrm3zkea.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (143, 'Chú ý xe đỗ.', 'chu_y_xe_đo.', 'Để cảnh báo có các loại xe ôtô, máy kéo, rơ-moóc hoặc sơ-mi rơ-moóc được kéo bởi xe ôtô hoặc ôtô đầu kéo, xe máy chuyên dùng đang đỗ chiếm một phần đường xe chạy.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370178/a1ysfcwxobzujxmslpkl.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (144, 'Đường ngầm có nguy cơ lũ quét', 'đuong_ngam_co_nguy_co_lu_quet', 'Báo trước những chỗ có đường ngầm (đường tràn). Đường ngầm là những đoạn đường vượt qua sông, suối, khe cạn mà nước có thể chảy tràn qua mặt đường thường xuyên có nguy cơ có lũ quét.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370236/hjkpfdwczagmkeljokut.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (145, 'Đi chậm', 'đi_cham', 'Dùng để nhắc lái xe giảm tốc độ đi chậm. Đối với các tuyến đường đối ngoại, bắt buộc dùng biển này.', '2024-11-28 01:45:38', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370248/gbwyilph1rhe52gc9uov.png', 2);
INSERT INTO `tbl_traffic_sign` VALUES (146, 'Loại xe hạn chế qua cầu', 'loai_xe_han_che_qua_cau', 'được đặt bên dưới biển báo số P.106a “Cấm xe ô tô tải” để chỉ các loại xe tải chịu hiệu lực của biển báo và trọng tải toàn bộ xe cho phép (bao gồm trọng tải bản thân xe và khối lượng chuyên chở cho phép) tương ứng với mỗi loại xe không phụ thuộc vào số lượng trục.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370597/fhvcvuht71ujtc8etvmm.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (147, 'Phạm vi tác dụng của biển', 'pham_vi_tac_dung_cua_bien', 'Để thông báo chiều dài đoạn đường nguy hiểm hoặc cấm hoặc hiệu lệnh hoặc hạn chế bên dưới một số biển báo chính) Chiều dài đoạn nguy hiểm hoặc cấm hoặc hạn chế ghi theo đơn vị mét (m) và lấy chẵn đến hàng chục mét.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370615/wtlw4t50xgj3enxe9e5p.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (148, 'Khoảng cách đến đối tượng báo hiệu', 'khoang_cach_đen_đoi_tuong_bao_hieu', 'Bên dưới các loại biển báo nguy hiểm, biển báo cấm, biển hiệu lệnh và chỉ dẫn, trong trường hợp vị trí đặt các biển báo đó khác với quy định chung, đặt biển số S.502 \"Khoảng cách đến đối tượng báo hiệu\" để thông báo khoảng cách thực tế từ vị trí đặt biển đến đối tượng báo hiệu ở phía trước.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370774/y3idxw36hltpqdilyfjy.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (149, 'Làn đường', 'lan_đuong', 'Biển số S.504 được đặt bên trên làn đường và dưới các biển báo cấm và biển hiệu lệnh hay bên dưới đèn tín hiệu để chỉ làn đường chịu hiệu lực của biển báo hay đèn tín hiệu (khi kết hợp trên cùng một mặt biển, chỉ cần vẽ mũi tên chỉ làn đường).', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734370807/rnkisp7joehxwjdhqtu0.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (150, 'Loại xe', 'loai_xe', 'Biển số S.505a được đặt bên dưới các biển báo cấm và biển hiệu lệnh hay biển chỉ dẫn để chỉ loại xe chịu hiệu lực của biển báo cấm, biển hiệu lệnh hay biển chỉ dẫn. Tùy theo loại xe chịu hiệu lực mà bố trí hình vẽ cho phù hợp.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371103/rtklgf6lawlgpxmhapmd.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (151, 'Hướng tác dụng của biển', 'huong_tac_dung_cua_bien', 'Đối với các tuyến đường đối ngoại và các tuyến đường có nhiều người đi lại có thể sử dụng biển phụ S.H,3a; S.H,3b; S.H,3c (Biển H,3 (a,b,c) theo GMS).', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371231/k9c1zu67bjwliajzzq3l.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (152, 'Hướng tác dụng của biển', 'huong_tac_dung_cua_bien', 'Các biển số S.503 (a,b,c) đặt bên dưới các biển báo cấm, biển hiệu lệnh để chỉ hướng tác dụng của biển là hướng vuông góc với chiều đi.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371247/zhfihyyuxpmbjkoz7oer.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (153, 'Hướng tác dụng của biển', 'huong_tac_dung_cua_bien', 'Các biển số S.503 (d,e,f) đặt bên dưới biển số P.124 (a,b,c,d,e,f), biển số P.130 \"Cấm dừng xe và đỗ xe\", biển số P.131 (a,b,c) \"Cấm đỗ xe\" để chỉ hướng tác dụng của biển là hướng song song với chiều đi.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371260/x4hymrexyraiitjgyldg.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (154, 'Tải trọng trục hạn chế qua cầu', 'tai_trong_truc_han_che_qua_cau', 'Biển số S.505c được đặt bên dưới biển báo số P.106a “Cấm ôtô xe tải” để chỉ các loại xe tải có tải trọng trục lớn nhất cho phép tương ứng với mỗi loại trục (trục đơn, trục kép, trục ba).', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371122/ygyw39i7dajwt7eauyw9.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (155, 'Hướng đường ưu tiên', 'huong_đuong_uu_tien', 'Biển số S.506a được đặt bên dưới biển chỉ dẫn số I.401 trên đường ưu tiên để chỉ dẫn cho người tham gia giao thông trên đường này biết hướng đường ưu tiên ở ngã tư.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371149/imvk0ocq0myn8vsbrcs3.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (156, 'Hướng rẽ', 'huong_re', 'Biển số S.507 được sử dụng độc lập để báo trước cho người tham gia giao thông biết chỗ rẽ nguy hiểm và để chỉ hướng rẽ.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371195/s63tjjfpe9lmshmbzsrk.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (157, 'Biểu thị thời gian', 'bieu_thi_thoi_gian', 'Được đặt dưới biển báo cấm hoặc biển hiệu lệnh nhằm quy định phạm vi thời gian hiệu lực của các biển báo cấm, biển hiệu lệnh cho phù hợp yêu cầu.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371208/y4smdcdzja8x5nhcsjgn.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (158, 'Thuyết minh biển chính', 'thuyet_minh_bien_chinh', 'Để bổ sung cho biển số W.239 \"Đường cáp điện ở phía trên\", có thể đặt biển số S.509a \"Chiều cao an toàn\" bên dưới biển số W.239, biển này chỉ rõ chiều cao cho các phương tiện đi qua an toàn.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371369/i2lnfrwqs6k1oqsn2p1y.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (159, 'Chú ý đường trơn có băng tuyết', 'chu_y_đuong_tron_co_bang_tuyet', 'Để cảnh báo đường trơn, có tuyết trong những ngày trời có tuyết, đặt biển phụ số S.510a “Chú ý đường trơn có băng tuyết”. Biển hình chữ nhật nền đỏ, chữ và viền màu trắng.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371392/eo0dyydmlb9tdp0dd2s6.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (160, 'Biển chỉ dẫn tới địa điểm cắm trại, tới nhà trọ', 'bien_chi_dan_toi_đia_điem_cam_trai,_toi_nha_tro', 'Để chỉ dẫn tới địa điểm cắm trại hoặc nhà trọ, đặt biển số S.G,7 \"Địa điểm cắm trại\" hoặc S.G,8 “Địa điểm nhà trọ”.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371417/khkhfdthb14qdu414gb8.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (161, 'Biển chỉ dẫn số lượng làn và hướng đi cho từng làn', 'bien_chi_dan_so_luong_lan_va_huong_đi_cho_tung_lan', 'Để thông báo cho lái xe số làn và hướng đi của từng làn xe, đặt biển số S.G,11a; S.G,11c; các biển này phải có số mũi tên bằng số lượng làn xe đi cùng hướng và phải chỉ dẫn số lượng làn xe của hướng đi sắp tới.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371476/pwxjiciuhqhuljojmeic.jpg', 3);
INSERT INTO `tbl_traffic_sign` VALUES (162, 'Biển chỉ dẫn làn đường không lưu thông', 'bien_chi_dan_lan_đuong_khong_luu_thong', 'Để chỉ dẫn cho lái xe biết làn đường không lưu thông, đặt biển S.G,12a; S.G,12b.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371630/wiyvg05pfylan29peh0b.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (163, 'Chỉ dẫn tới điểm đỗ xe dành cho lái xe muốn sử dụng phương tiện công cộng', 'chi_dan_toi_điem_đo_xe_danh_cho_lai_xe_muon_su_dung_phuong_tien_cong_cong', 'Để chỉ dẫn tới địa điểm đỗ xe dành cho xe có lái xe muốn sử dụng phương tiện công cộng, đặt biển số S.G,9b.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371677/thdgkd8vinfsj5c2dsj9.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (164, 'Biển báo phụ “Ngoại lệ”', 'bien_bao_phu_“ngoai_le”', 'Để chỉ các trường hợp mà biển cấm hoặc hạn chế được coi là không áp dụng đặc biệt cho một nhóm đối tượng tham gia giao thông nào đó, đặt biển S.H,6 và thể hiện nhóm đối tượng đó cùng với cụm từ “Except - Ngoại lệ”.', '2024-11-28 02:06:55', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734371809/sof0hqygzg2glabmclvl.png', 3);
