INSERT INTO `tbl_traffic_sign` VALUES (174, 'Hướng đi vòng trái chướng ngại vật', 'huong_đi_vong_trai_chuong_ngai_vat', 'Hướng đi vòng trái chướng ngại vật', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734372906/dfeflz456krpm3opwpzv.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (175, 'Hướng đi vòng phải hoặc trái chướng ngại vật', 'huong_đi_vong_phai_hoac_trai_chuong_ngai_vat', 'Hướng đi vòng phải hoặc trái chướng ngại vật', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734372915/dgqkwxbptxjz3ld5xxhc.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (176, 'Nơi giao nhau chạy theo vòng xuyến', 'noi_giao_nhau_chay_theo_vong_xuyen', 'Để báo cho các loại xe (thô sơ và cơ giới) phải chạy vòng theo đảo an toàn ở nơi đường giao nhau.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734372927/irum1kyfhaahavuhzp0l.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (177, 'Đường dành cho xe thô sơ', 'đuong_danh_cho_xe_tho_so', 'Để báo đường dành cho xe thô sơ (kể cả xe của người tàn tật) và người đi bộ', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734372939/w3f2smuuw1tqldnivapr.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (178, 'Đường dành cho người đi bộ', 'đuong_danh_cho_nguoi_đi_bo', 'Để báo đường dành cho người đi bộ.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734373197/fuzgxumc1r0fzf8ayq3t.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (179, 'Tốc độ tối thiểu cho phép', 'toc_đo_toi_thieu_cho_phep', 'Để báo tốc độ tối thiểu cho phép các xe cơ giới chạy.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734373998/fn9nhz3n9djprang9lla.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (180, 'Hết tốc độ tối thiểu', 'het_toc_đo_toi_thieu', 'Đến hết đoạn đường tốc độ tối thiểu, đặt biển số R.307 \"Hết hạn chế tốc độ tối thiểu\" (hoặc đặt biển số DP.135 \"Hết tất cả các lệnh cấm\", nếu đồng thời có nhiều biển cấm khác hết tác dụng).', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374007/u4unjzk3p0ahzzs3u5ef.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (181, 'Tuyến đường cầu vượt cắt qua a', 'tuyen_đuong_cau_vuot_cat_qua_a', 'Biểu thị phía trước có cầu vượt, xe có thể đi thẳng hoặc theo chỉ dẫn trên hình vẽ để rẽ trái (hay rẽ phải), đặt biển số R.308 (a,b) “Tuyến đường cầu vượt cắt ngang”. Biển đặt tại vị trí thích hợp trước cầu vượt để hướng dẫn xe đi thẳng hoặc rẽ trái (hay rẽ phải).', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374509/c79glpexhrcepqfbvd5n.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (182, 'Tuyến đường cầu vượt cắt qua b', 'tuyen_đuong_cau_vuot_cat_qua_b', 'Biểu thị phía trước có cầu vượt, xe có thể đi thẳng hoặc theo chỉ dẫn trên hình vẽ để rẽ trái (hay rẽ phải), đặt biển số R.308 (a,b) “Tuyến đường cầu vượt cắt ngang”. Biển đặt tại vị trí thích hợp trước cầu vượt để hướng dẫn xe đi thẳng hoặc rẽ trái (hay rẽ phải).', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374518/sqcrz6aclnbvmxid1t1l.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (183, 'Ấn còi', 'an_coi', 'Biểu thị xe cộ đi đến vị trí đặt biển đó thì phải ấn còi. Đặt biển ở trước khúc đường ngoặt gấp hoặc sắp vào đường đèo dốc dọc lớn hơn 10%, tầm nhìn bị hạn chế.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374531/l1pnxcbo3sbgcwtd4hdr.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (184, 'Hướng đi phải theo cho các xe chở hàng nguy hiểm a', 'huong_đi_phai_theo_cho_cac_xe_cho_hang_nguy_hiem_a', 'Để báo cho các loại xe chở hàng nguy hiểm phải đi theo hướng quy định, đặt một trong những kiểu biển số R.310(a,b,c) \"Hướng đi phải theo cho các xe chở hàng nguy hiểm \". Tùy theo hướng đi mà chọn kiểu biển cho phù hợp.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374549/ttenrxndtgp8emqtsw3z.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (185, 'Hướng đi phải theo cho các xe chở hàng nguy hiểm b', 'huong_đi_phai_theo_cho_cac_xe_cho_hang_nguy_hiem_b', 'Để báo cho các loại xe chở hàng nguy hiểm phải đi theo hướng quy định, đặt một trong những kiểu biển số R.310(a,b,c) \"Hướng đi phải theo cho các xe chở hàng nguy hiểm \". Tùy theo hướng đi mà chọn kiểu biển cho phù hợp.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374578/jwf6sfbfpmmo7ynfzg4r.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (186, 'Hướng đi phải theo cho các xe chở hàng nguy hiểm c', 'huong_đi_phai_theo_cho_cac_xe_cho_hang_nguy_hiem_c', 'Để báo cho các loại xe chở hàng nguy hiểm phải đi theo hướng quy định, đặt một trong những kiểu biển số R.310(a,b,c) \"Hướng đi phải theo cho các xe chở hàng nguy hiểm \". Tùy theo hướng đi mà chọn kiểu biển cho phù hợp.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374597/nvq913k0g1qalatmqhzd.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (187, 'Đường dành cho xe ô tô', 'đuong_danh_cho_xe_o_to', 'Để báo hiệu bắt đầu đường dành cho các loại ô tô đi lại.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374611/bkwazhrd4gjmddgrgh1u.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (188, 'Đường dành cho xe ô tô, xe máy', 'đuong_danh_cho_xe_o_to,_xe_may', 'Để báo hiệu bắt đầu đường dành cho các loại ô tô, xe máy đi lại.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374621/aphstpicy1dxggpdiilm.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (189, 'Đường dành cho xe buýt', 'đuong_danh_cho_xe_buyt', 'Để báo hiệu bắt đầu đường dành cho xe buýt.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734374727/eaxyti6quncbm8pawjan.png', 4);
