INSERT INTO `tbl_traffic_sign` VALUES (197, 'Hết đoạn đường dành cho xe máy và xe đạp', 'het_đoan_đuong_danh_cho_xe_may_va_xe_đap', 'Đến hết đoạn đường dành cho xe máy, xe đạp, kể cả xe gắn máy đi lại.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734376202/be4ghaxbl0h4isz9mszl.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (198, 'Hướng đi trên mỗi làn đường phải theo', 'huong_đi_tren_moi_lan_đuong_phai_theo', 'Để báo hiệu cho người tham gia giao thông biết số lượng làn đường trên mặt đường và hướng đi trên mỗi làn đường theo vạch kẻ đường, đặt biển số R.411 \"Hướng đi trên mỗi làn đường theo vạch kẻ đường\". Biển sử dụng phối hợp với vạch kẻ đường (loại vạch 9.3: vạch mũi tên chỉ hướng trên mặt đường). Tùy theo tình hình thực tế về số lượng làn đường và hướng đi trên mỗi làn đường mà có ký hiệu phù hợp. Biển có tác dụng bắt buộc người tham gia giao thông phải đi đúng làn đường đã được chỉ dẫn hướng phù hợp với hành trình của xe.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734376484/ryftcrgzzlyersyiveei.jpg', 4);
INSERT INTO `tbl_traffic_sign` VALUES (199, 'Làn đường dành cho xe ô tô khách', 'lan_đuong_danh_cho_xe_o_to_khach', 'Làn đường dành riêng cho ô tô khách (kể cả ô tô buýt). Trong trường hợp cần phân làn các loại xe khách theo số chỗ ngồi thì ghi số chỗ ngồi cho phép của xe khách lên thân xe trong hình vẽ của biển (Ví dụ: “< 16c”. Khi báo hiệu làn đường dành riêng cho xe buýt nhanh, bổ sung thêm cụm từ “BRT” trên biển R.412a.', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734376605/uzj3tpnpeg8kvjbncnu7.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (200, 'Làn đường dành cho xe ô tô con', 'lan_đuong_danh_cho_xe_o_to_con', 'Làn đường dành cho xe ô tô con', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734376653/jcf8ybqefd7oqpst2qpm.png', 4);
INSERT INTO `tbl_traffic_sign` VALUES (201, 'Làn đường dành cho xe ôtô tải', 'lan_đuong_danh_cho_xe_oto_tai', 'Trong trường hợp cần phân làn các loại xe tải theo khối lượng chuyên chở cho phép thì ghi trị số khối lượng chuyên chở cho phép của xe tải lên thân xe trong hình vẽ của biển (Ví dụ: “<3,5t”).', '2024-11-28 02:43:51', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734376684/xxe4e2kg1polb9domfr5.png', 4);
