INSERT INTO `tbl_traffic_sign` VALUES (229, 'Bắt đầu đường ưu tiên', 'bat_đau_đuong_uu_tien', 'Để biểu thị ưu tiên cho các phương tiện trên đường có đặt biển này được đi trước, đặt biển số I.401 “Bắt đầu đường ưu tiên”.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734377984/pdbvpy4ilwovq0hbgnfa.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (230, 'Đường phía trước có làn đường dành cho ô tô khách', 'đuong_phia_truoc_co_lan_đuong_danh_cho_o_to_khach', 'Để chỉ dẫn cho người tham gia giao thông biết đường phía trước có làn đường dành riêng cho ô tô khách theo chiều ngược lại, đặt biển số I.413a \"Đường phía trước có làn đường dành cho ô tô khách\". Biển được đặt ở nơi đường giao nhau đầu đường một chiều mà hướng ngược chiều có ô tô khách được phép chạy.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734379128/qlevicijkgxwfhqotdwf.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (231, 'Chỉ hướng đường', 'chi_huong_đuong', 'Ở các nơi đường bộ giao nhau, đặt biển số I.414 (a, b, c, d) \"Chỉ hướng đường\" để chỉ dẫn hướng đường đến các địa danh, khu dân cư. Trên biển cần chỉ dẫn cả số hiệu (tên) đường và cự ly (làm tròn đến kilômét; nếu cự ly < 1,0 km thì làm tròn đến 100 m):', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734379162/eg9tgalsubdzjeq70llz.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (232, 'Mũi tên chỉ hướng đi', 'mui_ten_chi_huong_đi', 'Trong khu đông dân cư, hoặc ở các đường giao nhau để chỉ dẫn hướng đi đến một địa danh lân cận tiếp theo và khoảng cách (làm tròn đến km) đến nơi đó, cần phải đặt biển số I.415 \"Mũi tên chỉ hướng đi\". Trong trường hợp địa danh gần thì không nhất thiết phải ghi khoảng cách.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734379209/njvepu8wyp9d7siwcfuf.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (233, 'Đường tránh', 'đuong_tranh', 'Để chỉ dẫn lối đi đường tránh, đường vòng trong trường hợp đường cấm vì lý do đường, cầu bị tắc hoặc thi công và cấm một số loại xe đi qua, đặt biển số I.416 \"Đường tránh\" trước các đường giao nhau.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734379302/iefnazyhdrfcdvkidnrl.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (234, 'Chỉ hướng đường phải đi cho từng loại xe', 'chi_huong_đuong_phai_đi_cho_tung_loai_xe', 'Ở các đường giao nhau trong trường hợp cấm hoặc hạn chế một số loại xe, khi cần thiết có thể đặt biển chỉ hướng đường phải đi cho từng loại xe đến một khu dân cư tiếp theo, đặt biển số I.417 (a, b, c) \"Chỉ hướng đường phải đi cho từng loại xe\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734379349/qbca42dzm47ipsbmco69.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (235, 'Lối đi ở những vị trí cấm rẽ', 'loi_đi_o_nhung_vi_tri_cam_re', 'Để chỉ lối đi ở các nơi đường giao nhau bị cấm rẽ, đặt biển số I.418 \"Lối đi ở những vị trí cấm rẽ\". Biển được đặt ở nơi đường giao nhau trước đường cấm rẽ.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734380042/ge7peslopfu5mxvqveoj.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (236, 'Chỉ dẫn địa giới', 'chi_dan_đia_gioi', 'Để chỉ dẫn địa giới hành chính giữa các thành phố, tỉnh, huyện, đặt biển số I.419(a,b) \"Chỉ dẫn địa giới\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734380071/day750rjul4e3bj5chib.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (237, 'Di tích lịch sử', 'di_tich_lich_su', 'Để chỉ dẫn những nơi có di tích lịch sử hoặc những nơi có danh lam thắng cảnh, những nơi có thể tham quan... ở hai ven đường.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734380117/r7wlvyc8hlvmde7rdglj.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (238, 'Vị trí người đi bộ sang ngang', 'vi_tri_nguoi_đi_bo_sang_ngang', 'Để chỉ dẫn người đi bộ và người tham gia giao thông biết vị trí dành cho người đi bộ sang ngang, đặt biển số I.423 (a,b) \"Vị trí người đi bộ sang ngang\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734380287/bhywjwk9lorrrsty9lei.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (239, 'Cầu vượt qua đường cho người đi bộ', 'cau_vuot_qua_đuong_cho_nguoi_đi_bo', 'Để chỉ dẫn cho người đi bộ sử dụng cầu vượt qua đường, đặt biển số I.424 (a,b) \"Cầu vượt qua đường cho người đi bộ\" và I.424 (c,d) \"Hầm chui qua đường cho người đi bộ.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734380298/xgommpuubegr7n5aze4v.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (240, 'Hết đoạn đường ưu tiên', 'het_đoan_đuong_uu_tien', 'Đến hết đoạn đường quy định là ưu tiên, đặt biển số I.402 \"Hết đoạn đường ưu tiên\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381177/c314cokgwgvio4vxoicz.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (241, 'Trạm kiểm tra tải trọng xe', 'tram_kiem_tra_tai_trong_xe', 'Để chỉ dẫn nơi đặt trạm kiểm tra tải trọng xe, đặt biển số I.427b \"Trạm kiểm tra tải trọng xe\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381220/vr6njlarymscoxpyf3dj.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (242, 'Trạm sửa chữa', 'tram_sua_chua', 'Để chỉ dẫn nơi đặt xưởng, trạm chuyên phục vụ sửa chữa ô tô, xe máy hỏng trên đường, đặt biển số I.427a \"Trạm sửa chữa\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381242/vodouelvqapzztqug8sx.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (243, 'Xe kéo rơ-moóc', 'xe_keo_ro-mooc', 'Để báo hiệu xe có kéo moóc hoặc xe kéo xe, đặt biển số I.443 \"Xe kéo rơ-moóc\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381281/rjiapbp4lvukn9trasal.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (244, 'Biển báo cầu vượt liên thông', 'bien_bao_cau_vuot_lien_thong', 'Biển đặt tại vị trí trước khi vào cầu vượt có tổ chức giao thông liên thông giữa các tuyến. Tùy theo nút giao mà bố trí biển số I.447a, I.447b, I.445c, I.447d cho phù hợp. Tại các lối rẽ thì sử dụng biển I.414c, d để báo các hướng đi.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381333/kg1o1fdn3dncge6fc2ps.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (245, 'Đường cụt', 'đuong_cut', 'Đường cụt là những đường xe không thể tiếp tục đi qua được. Những đường cụt có thể là những ngõ cụt (ở trong khu đông dân cư); đường hoặc cầu bị đứt do thiên tai, địch hoạ hoặc đường tránh dự phòng mà mà tại vị trí vượt sông, suối chưa có phương tiện vượt sông; đường đi vào cầu nhưng cầu hỏng v.v...', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381377/zhwfnvlzqlke6fzvqgfx.jpg', 5);
INSERT INTO `tbl_traffic_sign` VALUES (246, 'Được ưu tiên qua đường hẹp', 'đuoc_uu_tien_qua_đuong_hep', 'Để chỉ dẫn cho người tham gia giao thông cơ giới biết mình được quyền ưu tiên đi trước trên đoạn đường hẹp, đặt biển số I.406 \"Được ưu tiên qua đường hẹp', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381404/jebkrnvnoe6qrqnlhqk2.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (247, 'Đường một chiều', 'đuong_mot_chieu', 'Để chỉ dẫn những đoạn đường chạy một chiều, đặt biển số I.407(a,b,c) \"Đường một chiều\". Biển số I.407a đặt sau nơi đường giao nhau, khi đã có biển R302 tại các đầu dải phân cách thì không nhất thiết đặt biển số I.407a. Biển số I.407b,c đặt trước nơi đường giao nhau và đặt trên đường chuẩn bị đi vào đường một chiều.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381420/otifcsihzhmkbgvxfo11.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (248, 'Nơi đỗ xe', 'noi_đo_xe', 'Để chỉ dẫn những nơi được phép đỗ xe, những bãi đỗ xe, bến xe, v.v..., đặt biển số I.408 \"Nơi đỗ xe\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381541/tsdz66rzxpyz1ouubvb9.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (249, 'Nơi đỗ xe một phần trên hè phố', 'noi_đo_xe_mot_phan_tren_he_pho', 'Để chỉ dẫn những nơi được phép đỗ xe một phần trên hè phố rộng, đặt biển số I.408a \"Nơi đỗ xe một phần trên hè phố\". Xe phải đỗ sao cho các bánh phía ghế phụ trên hè phố.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381549/npf023djbpg7psurjvhs.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (250, 'Chỗ quay xe', 'cho_quay_xe', 'Để chỉ dẫn vị trí được phép quay đầu xe, đặt biển số I.409 \"Chỗ quay xe\".', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381561/xzgy0u5uorzmnkaxfrpn.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (251, 'Khu vực quay xe', 'khu_vuc_quay_xe', 'Để chỉ dẫn khu vực được phép quay đầu xe, đặt biển số I.410 \"Khu vực quay xe\". Trên biển mô tả cách thức tiến hành quay xe.', '2024-11-28 15:00:02', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734381570/ggiqgi5twg4udwpplnaf.png', 5);
INSERT INTO `tbl_traffic_sign` VALUES (261, 'test_image', 'test_image', 'abcd', '2024-12-04 21:45:53', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734382667/td8tj2h1uynax1uruyeu.png', 3);
INSERT INTO `tbl_traffic_sign` VALUES (263, 'testadd', 'testadd', 'abcddd', '2024-12-12 02:22:34', 'duydoba121002@gmail.com', 'https://res.cloudinary.com/drtibt2pc/image/upload/v1734382677/rsb7g6dc7g0pzndilkpy.png', 1);
INSERT INTO `tbl_traffic_sign` VALUES (264, 'Cấm đi ngược chiều', 'cam_di_nguoc_chieu', 'Biển báo này chỉ dẫn phương tiện không được phép di chuyển ngược chiều. Phạm vi áp dụng cho các đường một chiều và khu vực giao thông hạn chế.', '2024-10-03 01:00:40', 'duydoba121002@gmail.com', 'https://thietbigiaothong247.com/wp-content/uploads/2017/04/bien-cam-di-nguoc-chieu.jpg', 1);
